import React from 'react';
import openSocket from 'socket.io-client';

const socket = openSocket(window.location.href)

export class MeuSocket {
    constructor () {
        console.log(window.location.href);
        port = 3000;
        socket.listen(port);
        console.log("listening on port " + port);
    }
}
